import React from 'react';
import { BrowserRouter as Router, Route } from 'react-router-dom';
import Navigation from './components/Navbar';
import Login from './Routes/Login'; // Import your Login component
import Register from './Routes/Register'; // Import your Register component
import PatientDashboard from './Users/patient'; // Import your PatientDashboard component
import DoctorDashboard from './Users/doctor'; // Import your DoctorDashboard component
 // Import your DoctorDashboard component

function App() {
  return (
    <Router>
      <div>
        <Navigation />
        <Routes> {/* Wrap your Route components within a Routes component */}
          <Route path="/login" element={<Login />} />
          <Route path="/register" element={<Register />} />
          <Route path="/patient" element={<PatientDashboard />} />
          <Route path="/doctor" element={<DoctorDashboard />} />
          {/* Add more routes for other user roles */}
        </Routes>
      </div>
    </Router>
  );
}

export default App;
